import React from "react";
import axios from "axios";

class UploadButton extends React.Component {

    constructor (props) {
        super (props)
        this.state = {
          jwtToken: ''
        }
    }

    fetchJwtToken = async () => {
        let result = await axios.post(
            'http://localhost:8080/authenticate',
            {
                username: 'image-extract-info-user',
                password: 'KA#$DlAQw^7d2eFOMetdd'
            }
        ).then(
            (res) => {
                console.log("JWT token fetch")
                console.log(res)
                this.setState({jwtToken: res.data.jwt})
            }
        )
        return result
    }

    processImage = async () => {
        let result = this.fetchJwtToken();
        console.log(this.state.jwtToken)
        let file = this.props.image
        let formData = new FormData();
        formData.append('image', file)
        formData.append('selectedOptions', JSON.stringify(this.props.selectedOptions))
        console.log(this.props.selectedOptions)
        const config = {
            headers: {
                "Origin": "http://localhost:3000",
                "Authorization": "Bearer "+this.state.jwtToken
            }
        }
        axios.post(
            'http://localhost:8080/image/extract',
            formData,
            config
        ).then(
            (res) => {
                console.log(res);
                this.props.setResponse(res)
            }
        )
    }

    render() {
        return <div>
            <input type="submit" value="Upload" onClick={this.processImage}/>
        </div>
    }
}

export default UploadButton;
